import ReactQuill from 'react-quill';
import 'react-quill/dist/quill.snow.css';

const modules = {
  toolbar: [
    ["header", "font", "size", "background", "color", "bold", "italic", "underline", "link", "code"]
  ]
}

const App = () => {
    return (
        <ReactQuill modules = {modules} theme="snow"/>
    )
}

export default App;
